import React from "react";
import * as ReactDOMClient from "react-dom/client";

let i = 0;
function inputClick() {
    console.log("Нажато " + i)
    i++;
}

function onInput(e) {
    console.log("Введено что-то")
    let inp = document.getElementById('inp1');
    inp.innerHTML = e;
    console.log(e);
}

function App() {
    return (<div>
        <input id="inputForm" placeholder="Введите логин" 
        onInput = {onInput} onClick = {inputClick} />
        <p id="inp1"></p></div>)
}

const app = ReactDOMClient.createRoot(document.getElementById("app"));

app.render(<App />);
